import React, { useState } from "react";
import "./App.css";
import Content from "./content";

function App() {
  const [count, setCount] = useState(0);
  const increase = () => {
    setCount((pre) => pre + 1);
  };
  // console.log("re-render");
  return (
    <div className="App">
      <header className="App-header">
        <Content />
        <h2>Counter: {count}</h2>
        <button onClick={increase}>Increase</button>
      </header>
    </div>
  );
}

export default App;
